import React from 'react';
import ProductCard from '../components/ProductCard';

const products = [
  { id: 1, title: 'Laptop', price: 45000, image: 'https://via.placeholder.com/150' },
  { id: 2, title: 'Smartphone', price: 15000, image: 'https://via.placeholder.com/150' },
  { id: 3, title: 'Headphones', price: 2000, image: 'https://via.placeholder.com/150' },
];

const Home = () => {
  return (
    <div>
      <h2>Featured Products</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        {products.map((product) => (
          <ProductCard key={product.id} product={product} />
        ))}
      </div>
    </div>
  );
};

export default Home;
